import cars from './cars';
import { combineReducers } from 'redux';
import vins from './vins';
import vinAudit from './vinAudit';
import email from './email';
import years from './getYears';
import makes from './getMakes';
import models from './getModels';
import trims from './getTrims';
import blackVin from './BlackVin';
import blackCar from './BlackCar';
import blackModels from './BlackModels';
import blackTrims from './BlackTrims';
import blackValue from './BlackValue';

const rootReducer = combineReducers({
    vinAudit,
    cars, 
    vins,
    email, 
    years,
    makes,
    models,
    trims,
    blackVin,
    blackCar,
    blackModels,
    blackTrims,
    blackValue
})

export default rootReducer;
